```C#
    private void OnUseAction(ActionType action)
    {
        if (!Service.Configuration.EnableSynthHelper)
            return;

        var addonPtr = Service.GameGui.GetAddonByName("Synthesis");

        if (addonPtr.IsNull)
            return;
